import React from 'react';
import EmailField from '../atoms/InputField'
import AnchorLink from '../atoms/Link'
import Button from '../../components/atoms/Button'
import Paragraph from '../../components/atoms/Paragraph'
import Checkbox from '../../components/atoms/Checkbox'
import SvgEmail from '../../components/svg/Email'
import SvgPassword from '../../components/svg/Password'
import SvgPerson from '../../components/svg/Person'
import SvgLogo from '../../components/svg/Logo'

class NameForm extends React.Component {
    constructor(props) {
      super(props);
      this.state = {value: ''};
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
  
    handleChange(event) {
      this.setState({value: event.target.value});
    }
  
    handleSubmit(event) {
      alert('A name was submitted: ' + this.state.value);
      event.preventDefault();
    }
  
    render() {
      return (
        <form onSubmit={this.handleSubmit}>
          <label>
            Name:
            <input type="text" value={this.state.value} onChange={this.handleChange} />
          </label>
          <input type="submit" value="Submit" />
        </form>
      );
    }
  }
